import React, { memo } from 'react';
import {ItemSong} from './'

const ListSong = ({songs, totalDuration}) => {
    // console.log(songs, totalDuration)
    return (
        <div className='w-full flex flex-col'>
            <div className='flex justify-between items-center text-xs px-10 py-5 text-main-100 font-semibold border-b   border-b-[#ffffff0d]  rounded-[5px]'>
                <span>BÀI HÁT</span>
                <span>BÀI HÁT</span>
                <span>THỜI GIAN</span>
            </div>
            <table className="table-auto">
        <thead>
          <tr>
            <th>BÀI HÁT</th>
            <th>BÀI HÁT</th>
            <th>THỜI GIAN</th>
          </tr>
        </thead>
        <tbody>
        {songs?.map(item =>(
                <ItemSong 
                key={item.encodeId}
                songData= {item}
                />
                ))}
        </tbody>
      </table>


           
        </div>
    );
}

export default  memo(ListSong);
